import Jumbotron from "react-bootstrap/Jumbotron";

export default function Answer(props) {
  return (
    <>
      <Jumbotron fluid className="p-2 mb-2 mu-2">
        <div className="container">
          <p>{props.data.answerer.full_name}</p>
          <p>{props.data.body}</p>
        </div>
      </Jumbotron>
    </>
  );
}
